import "./Form.css";

function Form() {
  return (
    <div className="Form">
      <div className="Form-Purple-container"></div>
      <div className="EmployeeID-container">
        <h1 className="EmployeeID-text">Employee</h1>
      </div>
    </div>
  );
}

export default Form;
